import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>Placement Management</h1>
            <div>
                <Link to="/">Home</Link>
                <Link to="/admin">Admin Dashboard</Link>
                {/* Add more links as necessary */}
            </div>
        </nav>
    );
};

export default Navbar;
